import codewars_test as test
from kata import unpack

test.assert_equals(unpack([None, [1, ({2, 3}, {"foo": "bar"})]]), [None, 1, 2, 3, "foo", "bar"])
test.assert_equals(unpack([1, 2, [3, [4, 5], 6, [[7, ], [8, 9]]]]), [1, 2, 3, 4, 5, 6, 7, 8, 9])
test.assert_equals(unpack([{'a': {'b': 'c', 'd': 'e'}}]), ['c', 'e', 'b', 'd', 'a'])
test.assert_equals(unpack(['x', [1, 2, 4, [(1, 2), 3, 'y', 13],[1]], 1, 2, (12), {3, 2, 1}, {'a': 'b', 'c': 'd'}]), ['x', 1, 2, 4, 1, 2, 3, 'y', 13, 1, 1, 2, 12, 1, 2, 3, 'b', 'd', 'a', 'c'])
test.assert_equals(unpack(['x', [1, 2, 4, [(1, 2), 3, 'y', 13],[1]], 1, 2, (12), {3, 2, 1}, {(1, 2): 'b', 'c': (3, 4)}]), ['x', 1, 2, 4, 1, 2, 3, 'y', 13, 1, 1, 2, 12, 1, 2, 3, 'b', 3, 4, 1, 2, 'c'])
test.assert_equals(unpack(['x', [1, 2, 4, [(1, 2), 3, 'y', 13],[1]], 1, 2, (12), {3, 2, 1}, {(1, 2): {'foo': 'bar'}, 'c': (3, 4)}]), ['x', 1, 2, 4, 1, 2, 3, 'y', 13, 1, 1, 2, 12, 1, 2, 3, 'bar', 'foo', 3, 4, 1, 2, 'c'])
test.assert_equals(unpack(['x', [1, 2, 4, [(1, 2), 3, 'y', 13],[1]], 1, 2, (12), {3, 2, 1}, {(1, 2): {'foo': ['x', [1, 2, 4, [(1, 2), 3, 'y', 13],[1]], 1, 2, (12), {3, 2, 1}, {(1, 2): {'foo': 'bar'}, 'c': (3, 4)}]}, 'c': (3, 4)}]), ['x', 1, 2, 4, 1, 2, 3, 'y', 13, 1, 1, 2, 12, 1, 2, 3, 'x', 1, 2, 4, 1, 2, 3, 'y', 13, 1, 1, 2, 12, 1, 2, 3, 'bar', 'foo', 3, 4, 1, 2, 'c', 'foo', 3, 4, 1, 2, 'c'])
